"status":"completed"},"tags":[]},"source":["### **1. Introduction**\n","\n","**Bellabeat** is a high-tech company that manufactures health-focused smart devices for women, founded in 2013 by Urška Sršen and Sando Mur. Their products collect data on nutrition, activity, sleep and stress empowering women with knowledge which help them better understand their habits and make healthier decisions.\n","\n","Here is a list of their current products:\n","* Bellabeat app: provides users with health data related to their activity, sleep, stress, menstrual cycle and mindfulness habits. \n","* Leaf: a wellness tracker that can be worn as a bracelet,necklace or clip, connected to the Bellabeat app to track activity, sleep and stress.\n","* Time: a wellness watcg that tracks activity,sleep and stress, connected to the Bellabeat app to get insights into the user's wellness.\n","* Spring: a water bottle that tracks daily water intake, connected to the Bellabeat app to track hydration levels.\n","* Bellabeat membership: a subscription-bases membership program for users, with 24/7 access to fully personalized guidance on nutrition, activity, sleep, health, beauty and mindfulness based on lifestyle and goals.\n","\n","![Bellabeat products 2.jpg](attachment:4ca80001-b6b2-4e0e-8f2c-a114839bc29e.jpg)"]},{"cell_type":"markdown","id":"6e22fff5","metadata":{"_cell_guid":"1f4286af-c04a-4bde-af7f-418ece4aa95e","_uuid":"c980d28c-a8c2-47b3-84d9-c4728787e23b","papermill":{"duration":0.167467,"end_time":"2022-03-19T13:41:36.367143","exception":false,"start_time":"2022-03-19T13:41:36.199676","status":"completed"},"tags":[]},"source":["### **2. Ask Phase**\n","\n","#### **Business task**\n","\n","This case study focuses on analyzing smart device usage data to gain insight into how consumers are using the Bellabeat device, which will help unlock new growth opportunities.\n","\n","#### **Stakeholders**\n","\n","* Urška Sršen - Bellabeat’s co-founder and Chief Creative Officer\n","* Sando Mur - Bellabeat’s co-founder and key member of Bellabeat executive team"]},{"cell_type":"markdown","id":"929c8f9d","metadata":{"_cell_guid":"90f6882d-9477-4a66-8c96-b747afc61df7","_uuid":"325ed926-f997-49a5-8fe3-8db767faa258","papermill":{"duration":0.165142,"end_time":"2022-03-19T13:41:36.697898","exception":false,"start_time":"2022-03-19T13:41:36.532756","status":"completed"},"tags":[]},"source":["### **3. Prepare Phase**\n","\n","#### **Dataset**\n","\n","The data source used for this analysis is [FitBit Fitness Tracker Data](http://www.kaggle.com/arashnic/fitbit), which is a public dataset made available through [Mobius](https://www.kaggle.com/arashnic). \n","\n","#### **Data privacy and accessibility**\n","\n","When verifying the [Metadata](https://www.kaggle.com/arashnic/fitbit/metadata) we can confirm that the dataset is an [open source](https://zenodo.org/record/53894#.X9oeh3Uzaao). The dataset has been generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016 and 05.12.2016. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring.\n","\n","#### **Data organization**\n","\n","The data comes in 18 .csv files with several rows for each subject (ID). Part of the files have a long format, and others have a wide format.\n","\n","#### **Data limitations**\n","\n","The data is original, comprehensive and cited.\n","However, it includes a small sample, a small period of data collection (31 days) and it doesn’t show any demographic information, which translates in highly possibly biased data. Another limitation is that the data is not current (2016)."]},{"cell_type":"markdown","id":"aa737e99","metadata":{"_cell_guid":"6b099889-f645-46ca-a4a0-b9d7c6dbbac8","_uuid":"59dc90a7-c83a-4874-9f7a-a3fc8c21c940","papermill":{"duration":0.171171,"end_time":"2022-03-19T13:41:37.035649","exception":false,"start_time":"2022-03-19T13:41:36.864478","status":"completed"},"tags":[]},"source":["### **4. Process Phase**\n","\n","#### **4.1. Analysis tool and tool preparation**\n","\n","The analysis has been performed in R, which provides an accessible language to organize, modify and clean dataframes, and create insightful data visualizations for this analysis."]},{"cell_type":"code","execution_count":1,"id":"5f015c8e","metadata":{"_cell_guid":"e632060f-54f5-46ef-9e92-ba31b169daf7","_uuid":"0039480d-7dbf-4f49-bd7d-f049caa06907","collapsed":false,"execution":{"iopub.execute_input":"2022-03-19T13:41:37.492487Z","iopub.status.busy":"2022-03-19T13:41:37.489285Z","iopub.status.idle":"2022-03-19T13:45:51.504511Z","shell.execute_reply":"2022-03-19T13:45:51.502609Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":254.301821,"end_time":"2022-03-19T13:45:51.504769","exception":false,"start_time":"2022-03-19T13:41:37.202948","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","also installing the dependency ‘vroom’\n","\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","also installing the dependency ‘rlang’\n","\n","\n","Warning message in install.packages(\"dplyr\"):\n","“installation of package ‘rlang’ had non-zero exit status”\n","Warning message in install.packages(\"dplyr\"):\n","“installation of package ‘dplyr’ had non-zero exit status”\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]}],"source":["# Installing the packages that we will use\n","\n","install.packages(\"readr\")\n","install.pack